import React from "react";
import Slide from "./Slide";
import {SlideData} from "./SlideData";
import AlbumPic from "./AlbumPic";
import Press from "./Press";

function Home(){
  return(
    <div className = "w-100">
      <Slide slides = {SlideData}/>
      <AlbumPic/>
      <Press/>
    </div>
  )
}

export default Home;
